/*Data for the table `info_about` */

insert  into `info_about`(`aboutId`,`createdBy`,`createdDate`,`contents`,`updatedBy`,`updatedDate`) values ('05367b9d-580d-414e-971e-0f59b8415734','e1a019a9-dde5-452f-aafe-7195abdbee70','2022-05-06 10:26:34','<p class=\"text-justify\" style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: justify !important;\">Bhutan Power Corporation Limited (BPC) was formed as an offshoot of the erstwhile Department of Power, the then Ministry of Trade and Industry and was launched as Public Utility Company on 1st July 2002 with an objective that the corporatization of the utility functions would lead to greater efficiency and better delivery of electricity supply services in the power sector.</p><p class=\"text-justify\" style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: justify !important;\">Later, the Ownership was transferred to Druk Holding and Investment Limited (DHI), the commercial arm of the Royal Government of Bhutan, established in 2007 upon issuance of Royal Charter in 2007 ‚Äúto hold and manage the existing and future investments of the Royal Government for the long term benefit of the people of Bhutan‚Äù</p>',NULL,NULL);

