/*Data for the table `info_comment_policy` */

insert  into `info_comment_policy`(`policyId`,`createdBy`,`createdDate`,`contents`,`updatedBy`,`updatedDate`) values ('df1cb632-b14c-446d-acfd-93e5e1350187','91e6d937-8f62-43c6-9e96-c96d35362917','2022-04-29 08:51:20','<p><span style=\"color: rgb(114, 126, 140);\"><b>Comment Policy</b></span></p><p><span style=\"color: rgb(114, 126, 140);\">You must aware of following comments before adding your comment to the system:</span></p><ol><li><span style=\"color: rgb(114, 126, 140); font-size: 0.9rem;\">Comment only if it is extremely necessary and the subject must be relevant to target for the financial year only. </span></li><li><span style=\"color: rgb(114, 126, 140); font-size: 0.9rem;\">Avoid other discussions in the comment.</span></li><li><span style=\"color: rgb(114, 126, 140);\">Avoid foul comment targeting individual, organization or any other. </span></li><li><span style=\"color: rgb(114, 126, 140);\">It is not a social media platform to share, discuss and express right to speech. Therefore, discussing and expressing grievances, joy or any other irrelevant subject is prohibited.</span></li><li><span style=\"color: rgb(114, 126, 140); font-size: 0.9rem;\">Failure to maintain above decorum may result to a serious consequences or the admin may remove your comments anytime with or without your notice.</span></li><li><span style=\"color: rgb(114, 126, 140);\">Repeated offenders will be blocked from commenting and may hinder target progress.&nbsp;</span></li></ol>',NULL,NULL);

