insert  into `tf_bcpm_fin_target_writeup_a`(`writeupAuditId`,`createdBy`,`createdDate`,`background`,`cmdFlag`,`evalFormulaId`,`evalMethod`,`output`,`risks`,`targetAuditId`,`targetId`,`updatedBy`,`updatedDate`,`writeupId`) values ('63a6b8f7-d44d-4fc8-889b-52f49e2e4fd2','ea7049f4-6599-4178-a64a-7499d3366707','2022-04-08 10:28:44','<p class=\"ql-align-justify\"><span style=\"color: rgb(34, 34, 34);\">The Profit After Tax (PAT) target of Nu. </span><span style=\"color: black;\">80</span><span style=\"color: rgb(34, 34, 34);\"> million shall be evaluated solely based on the PAT figures in the Audited Financial Statements of 2022. Therefore, it is to be noted that both real business income as well as nominal income will naturally get accounted for in reaching at the PAT. The PAT has been set based on the revenue target.&nbsp;</span></p>','M',1,'<p>The achievement of the target will be evaluated as per <strong>Annexure I</strong>.</p>','<p class=\"ql-align-justify\">The PAT target for the year is set at Nu. 79.00 million.</p>','<p class=\"ql-align-justify\"><span style=\"color: rgb(34, 34, 34);\">&nbsp;&nbsp;i.&nbsp;&nbsp;The ongoing pandemic will likely impeded progress IT projects which could impact the bottomline. </span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(34, 34, 34);\">&nbsp;ii.&nbsp;&nbsp;If we recruit more people in the GST/BITS and ePIS projects to build local capacity and if we involve more of consultants from outside, the profit would not be as high as expected.&nbsp;</span></p>','5bd05192-727a-4719-8cdb-54ae0ee4e62a','aa89546c-d379-4b46-8570-3eefeb3a4b0b','ea7049f4-6599-4178-a64a-7499d3366707','2022-04-21 11:06:06','8e4a38a1-bbba-4b1d-98e7-38caea972ed0'),('6dce6281-e96f-4cda-9271-1f08073227e7','ea7049f4-6599-4178-a64a-7499d3366707','2022-04-08 10:28:44','<p class=\"ql-align-justify\"><span style=\"color: rgb(34, 34, 34);\">The Profit After Tax (PAT) target of Nu. </span><span style=\"color: black;\">80</span><span style=\"color: rgb(34, 34, 34);\"> million shall be evaluated solely based on the PAT figures in the Audited Financial Statements of 2022. Therefore, it is to be noted that both real business income as well as nominal income will naturally get accounted for in reaching at the PAT. The PAT has been set based on the revenue target.&nbsp;</span></p>','M',1,'<p>The achievement of the target will be evaluated as per <strong>Annexure I</strong>.</p>','<p class=\"ql-align-justify\">The PAT target for the year is set at Nu. 79.00 million.</p>','<p class=\"ql-align-justify\"><span style=\"color: rgb(34, 34, 34);\">&nbsp;&nbsp;i.&nbsp;&nbsp;The ongoing pandemic will likely impeded progress IT projects which could impact the bottomline. </span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(34, 34, 34);\">&nbsp;ii.&nbsp;&nbsp;If we recruit more people in the GST/BITS and ePIS projects to build local capacity and if we involve more of consultants from outside, the profit would not be as high as expected.&nbsp;</span></p>','4e56a694-bca7-446b-ab9f-1b439ead1b8d','aa89546c-d379-4b46-8570-3eefeb3a4b0b','91e6d937-8f62-43c6-9e96-c96d35362917','2022-04-20 02:59:21','8e4a38a1-bbba-4b1d-98e7-38caea972ed0'),('77109cde-c884-421d-914b-04f39e62b941','ea7049f4-6599-4178-a64a-7499d3366707','2022-04-08 10:30:09','<p><span style=\"color: rgb(34, 34, 34);\">The PAT per employee is a uniform target set across all DHI ‚Äì Owned Companies. This is also another tool for measuring how efficiently a company is utilizing its‚Äô Human Resources in the Company.</span></p>','M',1,'<p><span style=\"color: rgb(34, 34, 34);\">For the assessment of the target ‚ÄúPAT‚Äù as in target ‚Äú1.2‚Äù will be taken. </span>The PAT per employee will be calculated as below:</p><p>PAT per Employee = PAT/Average Staff during the year</p><p class=\"ql-align-justify\">The achievement of the target will be evaluated as per <strong>Annexure I.&nbsp;</strong></p><p><br></p>','<p><span style=\"color: rgb(34, 34, 34);\">The target for the year has been set at Nu. 0.69 million. pro</span></p>','<p><span style=\"color: rgb(34, 34, 34);\">The risk associated with PAT per employee is directly proportionate to the achievement of PAT. If the company can achieve revenue, no risk.</span></p>','43d65f6e-b700-4598-b9c7-4ec2f43963aa','9f260e52-7e27-4719-a04b-4d7d9270c551','268ad49d-3f58-4122-abb7-0c290ce25261','2022-04-11 06:37:07','13ff0215-c107-4026-b3cc-14aefcbc0d44'),('7b560c4a-1a28-4a48-87f5-c6c41cc9d2eb','ea7049f4-6599-4178-a64a-7499d3366707','2022-04-08 10:28:06','<p class=\"ql-align-justify\">As envisaged in the DHI Group Roadmap, the company has taken steps to evolve as an IT services provider ‚Äì catering to companies within DHI Group as well as other clients since 2019. The company‚Äôs focus is on becoming the Centre of Excellence of IT. The company has now become the biggest software company in Bhutan and we provide IT and IT enabled services (system development) to DHI Companies as well as government agencies, and other independent agencies. The main source of revenue for the Company IT services. </p><p>The budgeted revenue for the year is worked out in table below.asd</p>','M',1,'<p class=\"ql-align-justify\">The achievement of the target will be evaluated as per the methodology specified in <strong>Annexure I</strong>.dsd</p>','<p class=\"ql-align-justify\">The revenue target for the year 2022 has been set at Nu. 320.00 million. The revenue recognition will be based on on the actual revenue accrued in the year 2022.asd</p>','<p class=\"ql-align-justify\"><span style=\"color: rgb(34, 34, 34);\">&nbsp;i. There is risk associated with revenue from other IT projects too, as all targeted revenue are not definite since projects are not sure, except annual maintenance support charges from existing clients.</span></p><p><span style=\"color: rgb(34, 34, 34);\">&nbsp;ii.&nbsp;There is risk of TTPL losing tenants in case of global economic slowdown because all major tenants are FDI companies. asa</span></p>','02eb6c84-0773-48db-9cd7-1f34d6f7c096','994d487d-a82e-49b3-8b9c-dbcfd2d8fe76','ea7049f4-6599-4178-a64a-7499d3366707','2022-04-21 10:48:13','0bb3b74c-749c-4662-b70c-554c39a6d46d'),('830e2a4a-8efc-4e66-949d-198a83e5065b','ea7049f4-6599-4178-a64a-7499d3366707','2022-04-08 10:30:53','<p class=\"ql-align-justify\"><span style=\"color: rgb(34, 34, 34);\">The controllable expenses for the year 2022 have been set to Nu. 12.02 million, which is a decrease by 81% compared to previous year 2020. The cost heads are detailed out in Annexure II.&nbsp;</span></p>','M',2,'<p class=\"ql-align-justify\"><span style=\"color: rgb(34, 34, 34);\">If the total actual expenditure/consumption is less than the set target (Nu. 12.02 million), the full score will be awarded. For any achievement, more than or equal to the baseline i.e., 105% of the set target no score will be awarded. Other-wise score shall be prorated using following formula:</span></p><p>Score = (Baseline - Actual Achievement)/(Baseline - Target)</p>','<p class=\"ql-align-justify\"><span style=\"color: rgb(34, 34, 34);\">The Controllable expenses target for the year is set at Nu. 12.02 million.</span></p>','<p class=\"ql-align-justify\"><span style=\"color: rgb(34, 34, 34);\">There is no risk associated with this target.</span></p>','b55684e6-09fb-4851-a86a-a04150e962bb','fe3161cd-7ca9-4f06-a5c8-fca681c8e589','ea7049f4-6599-4178-a64a-7499d3366707','2022-04-08 10:42:36','fab67885-29cb-4c72-a7f5-b826e2d62f44'),('9421e85d-1e80-4639-af70-a28f072d1d80','ea7049f4-6599-4178-a64a-7499d3366707','2022-04-11 05:57:33','<p>apl</p>','C',1,'<p>ema</p>','<p>bana</p>','<p>coconui</p>','51372c87-9a8b-42a0-9c25-79cb1f829c0a','af141bd8-bc89-4aab-935e-28920492cbe0',NULL,NULL,'3b29a65d-b121-442e-b89c-4cdc9bd0d9fd'),('9f6190e4-4b2d-4a78-bf3c-93185718e91a','ea7049f4-6599-4178-a64a-7499d3366707','2022-04-08 10:28:06','<p class=\"ql-align-justify\">As envisaged in the DHI Group Roadmap, the company has taken steps to evolve as an IT services provider ‚Äì catering to companies within DHI Group as well as other clients since 2019. The company‚Äôs focus is on becoming the Centre of Excellence of IT. The company has now become the biggest software company in Bhutan and we provide IT and IT enabled services (system development) to DHI Companies as well as government agencies, and other independent agencies. The main source of revenue for the Company IT services. </p><p>The budgeted revenue for the year is worked out in table below.asd</p>','M',1,'<p class=\"ql-align-justify\">The achievement of the target will be evaluated as per the methodology specified in <strong>Annexure I</strong>.dsd</p>','<p class=\"ql-align-justify\">The revenue target for the year 2022 has been set at Nu. 320.00 million. The revenue recognition will be based on on the actual revenue accrued in the year 2022.asd</p>','<p class=\"ql-align-justify\"><span style=\"color: rgb(34, 34, 34);\">&nbsp;i. There is risk associated with revenue from other IT projects too, as all targeted revenue are not definite since projects are not sure, except annual maintenance support charges from existing clients.</span></p><p><span style=\"color: rgb(34, 34, 34);\">&nbsp;ii.&nbsp;There is risk of TTPL losing tenants in case of global economic slowdown because all major tenants are FDI companies. asa</span></p>','01c45a2f-e2a6-43a2-9dac-bfeeddda0c78','994d487d-a82e-49b3-8b9c-dbcfd2d8fe76','91e6d937-8f62-43c6-9e96-c96d35362917','2022-04-19 06:39:30','0bb3b74c-749c-4662-b70c-554c39a6d46d'),('aa36921d-9426-4af2-b041-2de921911f63','ea7049f4-6599-4178-a64a-7499d3366707','2022-04-08 10:31:38','<p><span style=\"color: rgb(34, 34, 34);\">The Return on Equity target is new target for the year. This is a uniform target set across all DHI ‚Äì Owned Companies.&nbsp;&nbsp;</span></p>','M',1,'<p class=\"ql-align-justify\"><span style=\"color: rgb(34, 34, 34);\">For the assessment of the target ‚ÄúReturn on Equity‚Äù </span>will be calculated as below:&nbsp;</p><p class=\"ql-align-justify\">Return on Equity = PAT/Average total equity of Previous year and current year end</p>','<p class=\"ql-align-justify\"><span style=\"color: rgb(34, 34, 34);\">The target for the year has been set at 19%.&nbsp;</span></p>','<p><span style=\"color: rgb(34, 34, 34);\">The risk associated with Return on Equity will depend on the PAT and equity of the Company. It is proportionate to an achievement of PAT.&nbsp;</span></p>','24b35148-a344-482d-b536-3bb2f3ff2011','6d44db2b-feb7-4755-8a36-ec56c6c73cd7','ea7049f4-6599-4178-a64a-7499d3366707','2022-04-08 10:44:38','7fb09742-4479-4e84-9e88-e61dc5204e34'),('b3dc572b-f1c4-4196-96e1-711a3bd267b0','ea7049f4-6599-4178-a64a-7499d3366707','2022-04-21 10:52:55','','C',1,'','','','d94087ac-92cd-410e-b22f-8a63a0aa7bc7','8af18020-ce3b-4f59-88f3-57253c1564bc',NULL,NULL,'04a44234-48c3-44c6-bfb1-0200def5705d'),('d445c33f-1efc-497e-a26e-525da846013f','ea7049f4-6599-4178-a64a-7499d3366707','2022-04-08 10:29:23','<p><span style=\"color: rgb(34, 34, 34);\">Revenue per employee is a uniform target set across all DHI ‚Äì Owned Companies to assess the productivity of the employees of the Companies and the measure of how efficiently a company is utilizing its employees.&nbsp;</span></p>','M',2,'<p class=\"ql-align-justify\"><span style=\"color: rgb(34, 34, 34);\">For the assessment of the target, the total revenue earned during the year will be taken. </span>The Revenue per employee will be calculated as below: </p><p class=\"ql-align-justify\">Revenue per Employee = Total Revenue/Average Staff during the year</p><p class=\"ql-align-justify\">The achievement of the target will be evaluated as per <strong>Annexure I</strong>.</p>','<p><span style=\"color: rgb(34, 34, 34);\">The target for the year has been set at Nu. </span><span style=\"color: black;\">2.78</span><span style=\"color: rgb(34, 34, 34);\"> million.&nbsp;</span></p>','<p class=\"ql-align-justify\"><span style=\"color: rgb(34, 34, 34);\">The risk associated with Revenue per employee is directly proportionate to the achievement of Revenue. If the company can achieve revenue, no risk. However, in between if the number of employees increases more than the targeted, there is a risk associated.&nbsp;&nbsp;</span></p>','3e5955a8-4466-4065-a37a-24e8b40191db','ec37dc5c-4c8d-42bf-b784-c84d15b11eb7','ea7049f4-6599-4178-a64a-7499d3366707','2022-04-08 10:39:03','7f7c1124-0763-4d15-bd91-11fa5088153e');

